description:
Alone Season 1 Complete incl Extra HDTV x264

Alone is ten-episode series is the country's boldest and longest survival experiment ever captured for television. It places ten hardcore survivalists alone in the Vancouver Island wilderness - no camera crew, no teams, no producers - on a single mission to stay alive. At stake is $500,000 awarded to the person who can last the longest. They will face extreme isolation and psychological distress as they plunge into the unknown, self-documenting their experience.

